INSERT INTO `art` VALUES ('41', '15', '什么是css的精灵技术', '<p style=\"text-indent:28px;text-autospace:ideograph-numeric;line-height:36px\"><span style=\"font-family: Verdana;color: rgb(35, 35, 35);letter-spacing: 0;font-size: 14px;background: rgb(255, 255, 255)\">CSS Sprites<span style=\"font-family:宋体\">在国内很多人叫</span><span style=\"font-family:Verdana\">css</span><span style=\"font-family:宋体\">精灵</span></span><span style=\"font-family: 宋体;color: rgb(35, 35, 35);letter-spacing: 0;font-size: 14px;background: rgb(255, 255, 255)\"><span style=\"font-family:宋体\">技术</span></span><span style=\"font-family: Verdana;color: rgb(35, 35, 35);letter-spacing: 0;font-size: 14px;background: rgb(255, 255, 255)\"><span style=\"font-family:宋体\">，是一种网页图片应用处理方式。它允许你将一个页面涉及到的所有零星图片都包含到一张大图中去，这样一来，当访问该页面时，载入的图片就不会像以前那样一幅一幅地慢慢显示出来了。对于当前网络流行的速度而言，不高于</span>200KB<span style=\"font-family:宋体\">的单张图片的所需载入时间基本是差不多的，所以无需顾忌这个问题。</span></span></p><p style=\"text-indent:28px;text-autospace:ideograph-numeric;line-height:36px\"><span style=\"font-family: Verdana;color: rgb(35, 35, 35);letter-spacing: 0;font-size: 14px;background: rgb(255, 255, 255)\">CSS Sprites<span style=\"font-family:宋体\">其实就是把网页中一些背景图片整合到一张图片文件中，再利用</span><span style=\"font-family:Verdana\">CSS</span><span style=\"font-family:宋体\">的</span><span style=\"font-family:Verdana\">“background-image”</span><span style=\"font-family:宋体\">，</span><span style=\"font-family:Verdana\">“background- repeat”</span><span style=\"font-family:宋体\">，</span><span style=\"font-family:Verdana\">“background-position”</span><span style=\"font-family:宋体\">的组合进行背景定位，</span><span style=\"font-family:Verdana\">background-position</span><span style=\"font-family:宋体\">可以用数字精确的定位出背景图片的位置。</span></span></p><p style=\"text-indent:28px;text-autospace:ideograph-numeric;line-height:36px\"><span style=\"font-family: Verdana;color: rgb(35, 35, 35);letter-spacing: 0;font-size: 14px;background: rgb(255, 255, 255)\"><span style=\"font-family:宋体\">在网页访问中，客户端每需要访问一张图片都会向服务器发送请求，所以，访问的图片数量越多，请求次数也就越多，造成延迟的可能性也就越大。</span></span></p><p style=\"text-indent:28px;text-autospace:ideograph-numeric;line-height:36px\"><span style=\"font-family: Verdana;color: rgb(35, 35, 35);letter-spacing: 0;font-size: 14px;background: rgb(255, 255, 255)\"><span style=\"font-family:宋体\">所以，</span>CSS Sprites<span style=\"font-family:宋体\">技术加速的关键，并不是降低质量，而是减少个数，当然随之而来的增加内存消耗，</span><span style=\"font-family:Verdana\">CSS Sprites</span><span style=\"font-family:宋体\">图片繁琐的合成等缺点在网站性能的提升前，也就不足为道了。</span></span></p><p><span style=\"font-family: Verdana;color: rgb(35, 35, 35);letter-spacing: 0;font-size: 14px;background: rgb(255, 255, 255)\">&nbsp;</span></p><p><br/></p>', '1559197214', '1559197214', '0', '5', '精灵技术,性能优化', '2019-05-30/5cef761e5d3a52.87577615.jpg', '2019-05-30/sm_5cef761e5d3a52.87577615.jpg', '2019-05-30/mid_5cef761e5d3a52.87577615.jpg', null);
