INSERT INTO `home` VALUES ('1', '练习&笔记', '要足够丰盛，才可以和世界平等对望，然后说声\"Hello World\"。', '项目实战', '没有什么比项目更有说服力，有的话那应该就是我比较帅吧。', '杰哥博客', '用文字记录点滴成长<br>技术，创作，杂谈，无所不欢', 'index.php?p=Home&c=Home&a=list', '自我介绍', 'FZ杰哥，就读于东莞理工学院计算机与网络安全学院，中共党员，曾任校内师友电脑维修部部长、为全校师生和其他校内人员提供电脑技术上的支援超过800余次、尝试运营新媒体（公众号）宣传，累计发文50余次，累计增粉5000+；自学PHP开发，喜欢带队参加各项比赛，并在其中取得了可观的开发经验，善于沟通、热爱总结，对自身要求较高，热爱技术、善于学习，富有责任心，能够接受挑战；日常喜欢设计，对于海报、UI、交互有一定的个人见解，能够更好地从用户角度思考问题。<br>\r\n2017年通过华为数通HCNA认证；<br>\r\n2017-2018连续两年获得学校单项奖学金；<br>\r\n2018获得中国高校计算机大赛微信小程序应用开发赛华南赛区二等奖；<br>\r\nQQ：747245429，微信：747245429\r\n', '敢于面对\r\n', '没有什么比面对自己更可怕的事情', '面对过去，不要迷离；面对未来，不必彷徨；活在今天，你只要把自己完全“展示“给别人。', '着手行动', '眼高手低只会让自己处于恐惧', '只有行动是治愈恐惧的良药，而犹豫、拖延将不断滋养恐惧。', '抱有自信', '只有相信才敢去天马行空', '没有天生的信心，只有不断培养的信心。', '项目实战', '以战养战，方能天下无敌', '创作不易，喜欢就请我喝杯奶茶吧~', '方寸间，历数世上桑田沧海；时空里，细问人间暑往寒来；是朋友，星移斗转情不改；是知音，天涯海角记心怀。', '#');
